    false,nt"url": null,nt"notes": "Summary report for the summer project of
    coyote scat analysis on Fish Springs National Wildlife Refuge.  The objective of
    this study was to determine what coyotes were consuming, and what percentage was
    birds.  The original motivation for this study was to gain information that would
    ultimately allow a decision to be made regarding whether or not there was reason
    to begin coyote population control on the refuge. While this preliminary study did
    provide a rough picture of what portion of the coyote diet may include birds, along
    with information to support the position that coyotes are preying upon birds during
    the nesting season, this study did not provide the information necessary to make
    a decision regarding coyote population control.  This report includes in-depth survey
    instructions for predator scat sampling.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
